// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;


import "./Security.sol";
import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./StringHelper.sol";

interface IMyMiniMiners {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function getTransferFee() external view returns (uint256);

}

contract GameActions is Security, ReentrancyGuard {
    using SafeMath for uint256;

    struct structItem {
        string id;
        address owner;
        uint256 cost;
        bool exists;
    }

    struct structGameBundles {
        string id;
        string bundleName;
        uint256 cost;
        uint256 totalSupply;
        bool exists;
    }

    mapping(string => structItem) items;
    string[] _gameBundlesRef;
    mapping(string => structGameBundles) _gameBundles;
    IMyMiniMiners myMiniMiners;


    event Buy(address indexed account, uint256 amount, string itemId);
    event Sell(address indexed account, uint256 amount, string itemId);
    event Remove(address indexed account, string itemId);
    event ChangeBundleTotalSupply(address indexed from, string id, uint256 totalSupply);
    event BuyGameBundle(address indexed from, string id, uint256 cost);
    event NewGameBundle(address indexed from, string id, uint256 cost, uint256 totalSupply, string bundleName);

    constructor(address feesAccount, address payable gameServiceAccount, address myMiniMinersAddress){
        setFeesAccount(feesAccount);
        setGameServiceAccount(gameServiceAccount);
        myMiniMiners = IMyMiniMiners(myMiniMinersAddress);
    }

    function getGameBundleIds(uint256 page) public view returns (string[] memory){
        uint256 j = 0;
        string[] memory refs = new string[](20);
        uint256 _gameBundlesRefLength = _gameBundlesRef.length;
        for (uint256 i = page * 20; i < page * 20 + 20 && i < _gameBundlesRefLength; i++) {
            refs[j] = _gameBundlesRef[i];
            j++;
        }
        return refs;
    }

    function getGameBundle(string calldata id) public view returns (structGameBundles memory){
        return _gameBundles[id];
    }

    function buyGameBundle(string calldata id) external nonReentrant {
        structGameBundles  memory currentItem = _gameBundles[id];
        require(currentItem.exists == true, "bundle does not exists");
        require(currentItem.totalSupply > 0, "bundle out of supply");
        if (currentItem.cost > 0) {
            myMiniMiners.transferFrom(_msgSender(), _feesAccount, currentItem.cost);
        }
        currentItem.totalSupply = currentItem.totalSupply.sub(1);
        _gameBundles[id] = currentItem;
        emit BuyGameBundle(_msgSender(), id, currentItem.cost);
    }

    function addGameBundle(string calldata id, uint256 cost, uint256 totalSupply, string calldata bundleName) external onlyFeesAccount {
        structGameBundles memory currentItem = _gameBundles[id];
        require(currentItem.exists == false, "bundle is all ready exists");

        structGameBundles memory newBundle;
        newBundle.bundleName = bundleName;
        newBundle.cost = cost;
        newBundle.totalSupply = totalSupply;
        newBundle.exists = true;
        newBundle.id = id;
        _gameBundles[id] = newBundle;
        emit  NewGameBundle(_msgSender(), id, cost, totalSupply, bundleName);
    }

    function changeGameBundleSupply(string calldata id, uint256 supply) external onlyFeesAccount {
        structGameBundles memory currentItem = _gameBundles[id];
        require(currentItem.exists == true, "bundle does not exists");
        currentItem.totalSupply = supply;
        _gameBundles[id] = currentItem;
        emit ChangeBundleTotalSupply(_msgSender(), id, supply);
    }

    function getItem(string memory itemId) public view returns (structItem memory){
        return items[itemId];
    }

    function _takeFee(address sender, address recipient, uint256 amount) private returns (uint256){

        uint256 fee = _calculateFee(amount, myMiniMiners.getTransferFee());
        amount = amount.sub(fee);
        myMiniMiners.transferFrom(sender, recipient, fee);
        return amount;

    }

    function _calculateFee(uint256 amount, uint256 fee) private pure returns (uint256){
        require(amount.div(10 ** 4).mul(10 ** 4) == amount, "amount is to small");
        return amount.mul(fee).div(10 ** 4);
    }

    function sell(address account, string calldata itemId, uint256 amount) external onlyGameService {
        require(account != address(0), "ERC20: sell to the zero address");
        StringHelper.validateAppTransactionId(itemId);
        require( !items[itemId].exists || items[itemId].owner == account, 'item needs to be owned by the same account ');

        structItem memory currentItem = items[itemId];

        currentItem.owner = account;
        currentItem.cost = amount;
        currentItem.id = itemId;
        currentItem.exists = true;

        items[itemId] = currentItem;

        emit  Sell(account, amount, itemId);
    }

    function buy(string calldata itemId) external nonReentrant {
        require(_msgSender() != address(0), "sender from the zero address");
        structItem memory currentItem = items[itemId];
        require(currentItem.exists, "item does not exists");
        require(currentItem.cost > 0, "the item is not for sale");

        uint256 cost = currentItem.cost;
        uint256 costAfterFee = _takeFee(_msgSender(), _feesAccount, cost);
        myMiniMiners.transferFrom(_msgSender(), currentItem.owner, costAfterFee);
        currentItem.owner = _msgSender();
        currentItem.cost = 0;
        items[itemId] = currentItem;

        emit Buy(_msgSender(), cost, itemId);
    }

    function removeFromMarket(string calldata itemId) external nonReentrant {
        require(_msgSender() != address(0), "sender from the zero address");
        structItem memory currentItem = items[itemId];
        require(currentItem.exists, "item does not exists");
        require(currentItem.owner == _msgSender(), "sender does not own the item");
        currentItem.cost = 0;
        items[itemId] = currentItem;
        emit Remove(_msgSender(), itemId);
    }


    //********************Game actions methods end************************//


}
